NX_FLIGHT_LOC = { ["A"] = "Alliance Flight", ["H"] = "Horde Flight", ["N"] = "Neutral Flight", }
Nx.NPCData={}
for dkey, dtbl in pairs(NX_MAP_DATA) do
    if dkey:sub(1,4)=="FLY_" then
        for k, v in pairs(dtbl) do
            local side, cont, zon, x, y = strsplit(",", k)
            local name = v
            name = NX_FLIGHT_LOC[side].."!"..name
            side = side=="A" and "$" or side=="H" and "%" or "#";
            cont,x,y,zon=tonumber(cont),tonumber(x),tonumber(y),tonumber(zon)						
            if Nx.ID2Zone[zon]+35>255 then Nx.prt("ERROR: Zone num goes over 255", zon, GetMapNameByID(zon)) end
            table.insert(Nx.NPCData, format("%s%c%s%c %c%c%c%c",side,name:len()+35,name,Nx.ID2Zone[zon]+35,x/221+35,x%221+35,y/221+35,y%221+35))
            local i = #Nx.NPCData
            Nx.GuideData["Flight Master"][cont]=Nx.GuideData["Flight Master"][cont]..format("%c%c",i/221+35,i%221+35)
        end
        NX_MAP_DATA[dkey] = nil
    end
end
NX_FLIGHT_LOC=nil
Nx.FlightConnection=""
